import Navbar from '../Navbar/navbar'
import Sidebar from '../Sidebar/sidebar';
import MainContent from '../MainContent/index';
import {useAuth} from '../AuthContext'
import React, {useEffect } from 'react';
// import BoxComponent from './components/Boxbar/box's

const Home = () => {
    const { userData } = useAuth();
const data = userData && userData[0]; // Null-check added
const { username, email, organization } = data || {};

    const containerStyle = {
        display: 'flex'
    };
    useEffect(() => {
        const fetchData = async () => {
            try {
                if (userData && userData.length > 0) {
                    const { username, email, organization } = userData[0];
                }
            } catch (error) {
               console.log("Error")
            }
        };

        fetchData();
    }, [userData]);

    return (
        <div>
            <Navbar userData={userData} />
            <div style={containerStyle}>
                <Sidebar />
                <MainContent userData={userData}/>
            </div>
        </div>
    );
}

export default Home;
